import React from 'react'

export default function Rating(props) {
    return (
      <div>
        <h1> Rating:{props.rating} </h1>
        {props.rating >= 1 ? (
          <IoIosStar />    
        ) : (         
          <IoIosStarOutline />    
        )}    
          {props.rating >= 2 ? (
          <IoIosStar />    
        ) : (        
          <IoIosStarOutline />    
        )}
          {props.rating >= 3 ? (
          <IoIosStar />    
        ) : (        
          <IoIosStarOutline />    
        )}
          {props.rating >= 4 ? (
        <IoIosStar />    
        ) : (        
          <IoIosStarOutline />    
        )}
          {props.rating >= 5 ? (
          <IoIosStar />    
        ) : (        
          <IoIosStarOutline />    
        )}  
      </div>
    );
  }
